import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element and click to open the cart
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the remove button of the item in the cart and click it
    await page.waitForSelector('.remove-item', { timeout: 5000 });
    await page.click('.remove-item');

    // Take screenshot after removing the item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_removed.png'));

    // Verify that the item has been removed
    const cartEmptyText = await page.locator('.empty-cart').textContent();
    const isCartEmpty = cartEmptyText.includes('Your cart is empty');

    return {
      success: true,
      action: "Removed item from cart",
      extractedData: { isCartEmpty },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
